/*ReinforcedManagementReport = Lista de Informe Reforzado*/
import React, { useState } from "react"
import PropTypes from 'prop-types';

import {
  Row,
  Col,
  Card,
  CardBody,
  CardHeader,
  Button,
  Label,
  Table
} from "reactstrap"

import { AvForm, AvField } from "availity-reactstrap-validation"

//i18n
import { withTranslation } from "react-i18next"


const Conslusiones = (props) => {

    
  function handleSubmit(event, errors, values) {
    event.preventDefaulprops.t();
    if (errors.length > 0) {
      return;
    }
    //props.onSubmiprops.t(values);
  }
  
  return (
     
    <React.Fragment>
        
        <Row>
      <Col lg="12">
      <p className="card-title-desc"></p>
        <h4 className="card-title"></h4>
        <p className="card-title-desc"></p>
        
        <AvForm id="frmSearch" className="needs-validation" onSubmit={handleSubmit}>
        <Row>
        <Col md="12">
                  <div className="mb-3">
                    <Label htmlFor="field1">{ props.t("Conclusions") }</Label>
                    <AvField
                      className="form-control"
                      name="field1"
                      type="textarea" rows={7}
                      id="field1"/>
                  </div>
                </Col>
               </Row>              
              
        </AvForm>

      </Col>
    </Row>
  
        </React.Fragment>
    
    
  );

}

export default (withTranslation()(Conslusiones))
